import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import axios from "axios";


class TableRow extends Component {
    constructor(props) {
        super(props);
        this.deletesss = this.deletesss.bind(this);
    }
    deletesss(){
        axios.get('http://localhost:4000/zooInventory/deletemedicine/'+this.props.obj._id)
            .then(this.setState({redirect: true}))
            .catch(err => console.log(err))
        alert("Your Medicine Successfully Deleted....")
        window.location.replace('/viewMedicine');
    }
    render() {
        if(parseInt(this.props.obj.qty))
        return (
           <tr>
                <td>
                   {this.props.obj.itemno}
               </td>
               <td>
                   {this.props.obj.name}
               </td>
               <td>
                   {this.props.obj.qty}
               </td>
               <td>
                   {this.props.obj.reorderlevel}
               </td>
               <td>
                  
               </td>
           </tr>
        );
    }
}

export default TableRow;
